import * as React from "react";
import { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";

import Accordion from '@mui/material/Accordion';
import AccordionSummary from '@mui/material/AccordionSummary';
import AccordionDetails from '@mui/material/AccordionDetails';
import Typography from '@mui/material/Typography';
import ExpandMoreIcon from '@mui/icons-material/ExpandMore';

import Navbar from "./Navbar";

const Select = () => {

    const [data, setData] = useState([]);
    let navigate = useNavigate();

    const getData = async () => {
        await fetch('db.json', {
            headers: {
                'Content-Type': 'application/json',
                'Accept': 'application/json'
            }
        })
            .then((res) => res.json())
            .then((res) => {
                console.log(res);
                setData(res);
            });
    };

    useEffect(() => {
        const getDataAsync = async () => {
            await getData();
        }
        getDataAsync();
    }, []);

    return (
        <>
            <Navbar />
            {
            data.parents !== undefined && data.parents.length > 0 &&
            <h1>V채lkommen {data.parents[0].name}</h1>
          }
            <div className="select-header">
                <h1 className="select-h1">V책ra paket</h1>
                <p className="select-p"> V채lj mellan 3 olika storlekar nedan. <br />
                    Alla paket kommer i blandade f채rger.
                </p>
            </div>
            <div className='accordion-menu'>
                <Accordion>
                    <AccordionSummary
                        expandIcon={<ExpandMoreIcon />}
                        aria-controls="panel1a-content"
                        id="panel1a-header"
                    >
                        <Typography className='option-one'>
                            {
                                data.packages !== undefined && data.packages.length > 0 &&
                                <p>{data.packages.size}</p>
                            }
                        </Typography>
                    </AccordionSummary>
                    <AccordionDetails className='option-one'>
                        <Typography>
                            Lorem ipsum dolor sit amet, consectetur adipiscing elit. Suspendisse
                            malesuada lacus ex, sit amet blandit leo lobortis eget.
                        </Typography>
                    </AccordionDetails>
                </Accordion>

                <Accordion>
                    <AccordionSummary
                        expandIcon={<ExpandMoreIcon />}
                        aria-controls="panel2a-content"
                        id="panel2a-header"
                    >
                        <Typography className='option-two'>Storlek 50-56</Typography>
                    </AccordionSummary>
                    <AccordionDetails className='option-two'>
                        <Typography>
                            Lorem ipsum dolor sit amet, consectetur adipiscing elit. Suspendisse
                            malesuada lacus ex, sit amet blandit leo lobortis eget.
                        </Typography>
                    </AccordionDetails>
                </Accordion>

                <Accordion>
                    <AccordionSummary
                        expandIcon={<ExpandMoreIcon />}
                        aria-controls="panel3a-content"
                        id="panel3a-header"
                    >
                        <Typography className='option-three'>Storlek 56-62</Typography>
                    </AccordionSummary>
                    <AccordionDetails className='option-three'>
                        <Typography>
                            Lorem ipsum dolor sit amet, consectetur adipiscing elit. Suspendisse
                            malesuada lacus ex, sit amet blandit leo lobortis eget.
                        </Typography>
                    </AccordionDetails>
                </Accordion>
            </div>
        </>
    );
}

export default Select;
